import React from 'react';
import Typed from 'react-typed';
const Header = () => {
  return (
    <div className='header-wrap'>
      <div className='main_text'>
        <Typed>
          Hello Folks! I'm <br /> Krishna Sai Surendra Babu Kalluri <br />
        </Typed>
      </div>
    </div>
  );
};

export default Header;
